import {
    Box,
    Input,
    Heading,
    Fieldset,
    Field,
} from "@chakra-ui/react";

function TaskPage() {
    return (
        <Box p={15} maxW="md" mx="auto">
            <Heading
                mb={"6"}
                textAlign={"center"}
                color={"green.500"}
            >
                Tasks
            </Heading>

            <Fieldset.Root>
                <Stack>
                    <Fieldset.Legend>Hej</Fieldset.Legend>
                    <Fieldset.HelperText>d√•</Fieldset.HelperText>
                </Stack>

                <Fieldset.Content>
                    <Field.Root>
                        <Field.Label>Name</Field.Label>
                        <Input name={"name"} />
                    </Field.Root>
                </Fieldset.Content>
            </Fieldset.Root>



        </Box>
    );
}

export default TaskPage
